import { Link } from "react-router-dom";
function ArtistCard({ artist }) {
  return (
    <Link to={artist.external_urls.spotify}>
      <div className="card bg-transparent shadow text-white artist">
        <img
          className="card-img darken artist-img"
          src={artist.images[0].url}
          alt={artist.name}
        />
        <div className="card-img-overlay d-flex">
          <div className="d-flex justify-content-between align-items-center mx-2 my-2">
            <h3 className="m-0">{artist.name}</h3>
            <div className="d-flex ranking rounded-circle align-items-center">
              <h4 className="m-0">{"#" + artist.popularity}</h4>
            </div>
          </div>
          <p className="card-text">{artist.genres}</p>
        </div>
      </div>
    </Link>
  );
}

export default ArtistCard;
